try{ 
require.resolve(moduleName)
msg.channel.send("Module '"+ moduleName + "' is already installed!");  

}catch(err){
msg.channel.send("Installing/Updating node module '"+ moduleName + "'");  

var theModule = this.getWrexMods().require(moduleName);

if(theModule){
  msg.channel.send(""+ moduleName + " was installed to the bot!");  
}else{
  msg.channel.send("Error! Module NOT "+ moduleName + " installed to the bot!");  
}

}

